import React, { Component } from 'react';
import './App.css';





class App extends Component {

  color = {
    color:"blue",
  }

  dis={
    display:"none"
  }






  render(){
    let color , dis ;

    return(


     <div style={color} onClick ={this.cclick}>
       hello react page
       <div style={dis}>
         hello you 
       </div>
     </div>
    );
  }
}

export default App;
